import React, { Component } from 'react';
import logo from '../logo.svg';
import '../App.css';

class App extends Component {
  state = {
    users: []
  }

  render() {
    return (
      <div className="App">
        <h1>Users</h1>
      </div>
    );
  }
}

export default App;
